import Maps from "../../components/maps/maps";
import "./contact.css";
import React,{useState , useEffect} from 'react';
import GoogleMapReact from 'google-map-react';
export default function Contact(props) {
    const [cordinates , setCordinates] = useState(props);
    const MyCustomMarker = () => <span class="material-icons">place</span>;
    
    useEffect(() => {
       setCordinates(props);
   }, [props])
    return(
<div className="contact">
        <div className="contactBody">
            <div className="contactLeft">
                <h1>Contact</h1>
                <p>Addis Ababa,Ethiopia <br/> Phone Number: +251-111-588-547 <br/> Summit(Feyel Bet)</p>
            </div>
            <div className="contactRight"></div>
        </div>
        <div className="map">
           <GoogleMapReact
            yesIWantToUseGoogleMapApiInternals
            bootstrapURLKeys={{key:'THE KEY'}}
            defaultZoom={16}
            center={cordinates.center}
        >
            <MyCustomMarker
                lat={cordinates.center[0]}
                lng={cordinates.center[1]}
            />
        </GoogleMapReact>
         </div>
    </div>
    )
    
}
